                <form>
                   <label 
                     className="schoolLabel"
                     htmlFor="schoolInput">
                        Your School's Name:
                   </label>

                   <input 
                     className="schoolInput"
                     placeholder="Your School"
                     name="schoolInput"
                     id="schoolInput"
                     type="text"
                     required>
                   </input>

                   <input
                     className="schoolSubmit"
                     name="schoolSubmit"
                     type="submit">
                   </input>
                </form>
            </div>
        )
    }
}

export default EducationalForm;
